import { useState } from 'react';
import styled from 'styled-components';


export const HeaderWrapper = styled.div`
  padding:0;
  width:100vw;
  height:10vh;
`;
 
const Header = () => {
 
    return (
        <HeaderWrapper>

        </HeaderWrapper>
      );
}
 
export default Header;
